import React from "react";
import {
  GoogleMap,
  withScriptjs,
  withGoogleMap,
  Marker,
} from "react-google-maps";
/*
async function getData() {
  return fetch(
    "https://opendata.arcgis.com/datasets/bbb2e4f589ba40d692fab712ae37b9ac_1.geojson"
  )
    .then((response) => response.json())
    .then((responseJson) => {
      // jsonData is parsed json object received from url
      responseJson;
    })
    .catch((error) => {
      // handle your errors here
      console.error(error);
    });
}
async function setDat() {
  var data = await Promise.resolve(getData()).then((result) => result.json());
  return data;
} var data = setDat();
  console.log(data);*/

async function data() {
  fetch(
    "https://opendata.arcgis.com/datasets/bbb2e4f589ba40d692fab712ae37b9ac_1.geojson"
  )
    .then(function (response) {
      return response.json();
    })
    .then(function (responseJson) {
      // jsonData is parsed json object received from url
      console.log(responseJson);
      responseJson.features.forEach(function (cases) {
        return (
          <Marker
            key={cases.properties.OBJECTID}
            position={{
              lat: cases.properties.Lat,
              lng: cases.properties.Long_,
            }}
          />
        );
      });
    });
}
function Map() {
  return (
    <GoogleMap defaultZoom={3} defaultCenter={{ lat: 0, lng: 0 }}>
      {data()}
    </GoogleMap>
  );
}

const WrappedMap = withScriptjs(withGoogleMap(Map));
function App() {
  return (
    <div className="App" style={{ width: "100vw", height: "100vh" }}>
      <WrappedMap
        googleMapURL={
          "https://maps.googleapis.com/maps/api/js?v=3.exp&libraries=geometry,drawing,places&key=AIzaSyDnwT8wbcgGl3mz0qhqb4dJpdHl6k-D--4"
        }
        loadingElement={<div style={{ height: "100%" }} />}
        containerElement={<div style={{ height: "100%" }} />}
        mapElement={<div style={{ height: "100%" }} />}
      />
    </div>
  );
}
export default App;
